import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
       <BrowserRouter>
        <Navbar />
        <Routes>
          <Route exact path="/post" element={<Posts />} />
          <Route exact path="/postdetail" element={<Postdetail />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
